import React from 'react'

function Gallery() {
  return (
   <>
    <div className='container'>
    <div className='p-4'></div>
        <div className='row  border border-dark rounded p-3'>
           
            <div className='col-4 card p-0'>
                <img src="img/a2.jpg" height="300"/>
            </div>
        </div>
    </div>
   </>
  )
}

export default Gallery;
